import React from 'react';
import MySwiper from './MySwiper';
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper/modules';

import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

const Header = () => {
  return (
    <div className=" text-white bg-cover bg-center h-screen bg-[url('/src/assets/images/bg-1.png')]">
      
      
    <div className="container mx-auto px-40 flex flex-col items-center justify-center h-screen gap-6">
        <h2 className="text-5xl font-bold uppercase text-center">
          ГАРАНТИРОВАННЫЙ РОСТ ПРОДАЖ ЗА 2 МЕСЯЦА
        </h2>

        <Swiper
      // install Swiper modules
      modules={[Navigation, Pagination, Scrollbar, A11y]}
      spaceBetween={20}
      slidesPerView={2}
      navigation
      pagination={{ clickable: true }}
      scrollbar={{ draggable: true }}
      onSwiper={(swiper) => console.log(swiper)}
      onSlideChange={() => console.log('slide change')}
    >
      <SwiperSlide>Slide 1</SwiperSlide>
      <SwiperSlide>Slide 2</SwiperSlide>
      <SwiperSlide>Slide 3</SwiperSlide>
      <SwiperSlide>Slide 4</SwiperSlide>
      <SwiperSlide>Slide 4</SwiperSlide>
      
    </Swiper>
        <h3 className="text-3xl ">
          или следующий месяц БЕСПЛАТНО
        </h3>

        <a href="#" className="text-3xl bg-yellow-400 hover:bg-yellow-500 active:bg-yellow-600 text-white font-bold py-2 px-12 rounded-2xl shadow-lg">
          GO!
        </a>
      </div>
      
       
    </div>
  );
};

export default Header;
